import Header from "./Header";
import ServerList from "./ServerList";
import { Redirect } from "react-router";

function HomePage({props, authorized}) {
  if (authorized) {
    return <Redirect to="/"/>
  }
  return (
    <div>
      <Header {...props}></Header>
      <ServerList></ServerList>
    </div>
  );
}

export default HomePage;
